pom.xml添加依赖 <!-- 最好使用连接池 -->
<dependency> <groupId>org.apache.commons</groupId> <artifactId>commons-pool2</artifactId>
</dependency>
<!-- 下面的用不用无所谓 -->
<dependency> <groupId>org.springframework.boot</groupId> <artifactId>spring-boot-starter-cache</artifactId>
</dependency> 3个重要注解 @CachePut 表示将方法结果返回存放到缓存中。（ cache中查询到结果后继续执行后续 ） @Cacheable 表示先从缓存中通过定义的键查询，如果可以查询到数据，则返回，否则执行该方法，返回数据，并且将返回结果保存到缓存中。（ cache中查询到结果过不再执行后续 ） @CacheEvict 通过定义的键移除缓存，它有一个 Boolean 类型的配置项 beforeInvocation，表示在方法之前或者之后移除缓存。因为其默认值为false ，所以默认为方法之后将缓存移除 。 application.properties添加配置 # cache
spring.cache.type=redis
spring.cache.cache-names=redisCache
# 缓存超时时间，0为永不超时
spring.cache.redis.time-to-live=0ms 在DAO层添加注解（ 命名一定要注意，不要写错 ） @Service
public class UserService { // @CachePut(value = "redisCache" , key = "'redis_user_'+#result.id") public User insertUser(User user){ //模拟数据库操作 try { Thread.sleep(1000*1); } catch (InterruptedException e) { e.printStackTrace(); } return user; } @Cacheable(value = "redisCache" , key = "'redis_user_'+#id") public User getUser(int id){ //模拟数据库操作 try { Thread.sleep(1000*1); } catch (InterruptedException e) { e.printStackTrace(); } return new User(1, "name", "age"); } //命中率低，所以不采用缓存机制 public List<User> findUsers(String age){ return new ArrayList<User>(); } @CachePut(value = "redisCache" ,condition = "#result != 'null'", key = "'redis_user_'+#id") public User UpdateUser(int id, String name){ //此处调用 getUser 方法，该方法缓存注解失效 //所以这里还是会执行SQL，将查询到数据库中的最新数据 User user = this.getUser(id); if (user == null){ return null; } //模拟数据库操作 try { Thread.sleep(1000*1); } catch (InterruptedException e) { e.printStackTrace(); } return user; } @CacheEvict(value = "redisCache" , key = "'redis_user_'+#id", beforeInvocation = false) public int deleteUser(int id){ //模拟数据库操作 try { Thread.sleep(1000*1); } catch (InterruptedException e) { e.printStackTrace(); } return 1; }
} 在springboot启动类中添加启动cache缓存的注解 @SpringBootApplication
@EnableCaching
public class DemoRedisApplication { public static void main(String[] args) { SpringApplication.run(DemoRedisApplication.class, args); }
} 此时在controller中调用时间会缩短

