import java.util.ArrayList;
import java.util.Iterator;
import java.util.List; /**
* Java之List集合遍历的几种方法
*
* @author： Rodge
* @time： 2018年10月4日 下午1:21:02
* @version： V1.0.0
*/
public class ListTest { public static void main(String[] args) { List<String> list = new ArrayList<>(); list.add("java"); list.add("C"); list.add("C++"); list.add("C#"); list.add("PHP"); /* * 第一种：一般for循环 */ for (int i = 0; i < list.size(); i++) { System.out.println("一般for循环：" + list.get(i)); } /* * 第二种：增强for循环 */ for (String str : list) { System.out.println("增强for循环：" + str); } /* * 第三种：迭代器1遍历 */ for (Iterator<String> it = list.iterator(); it.hasNext();) { System.out.println("迭代器1遍历：" + it.next()); } /* * 第四种：迭代器2遍历 */ Iterator<String> it = list.iterator(); while (it.hasNext()) { System.out.println("迭代器2遍历：" + it.next()); } /* * 第五种：java8 Lambda表达式 */ list.forEach(s -> { System.out.println("java8 Lambda表达式：" + s); }); /* * 第六种：java8 stream 有序流 */ list.stream().forEach(s -> { System.out.println("java8 stream 有序流：" + s); }); /* * 第七种：java8 stream 并行流 */ list.parallelStream().forEach(s -> { System.out.println("java8 stream 并行流：" + s); }); } }

