我们使用一个简单的实体定义：Article(文章) @Data
@AllArgsConstructor
@NoArgsConstructor
@Builder
@Entity
@Table(name="article")
public class Article { @Id @GeneratedValue private Long id; @Column(nullable = false,length = 32) private String author; @Column(nullable = false, unique = true,length = 32) private String title; @Column(length = 512) private String content; private Date createTime;
} @Entity 表示这个类是一个实体类，接受JPA控制管理，对应数据库中的一个表 @Table 指定这个类对应数据库中的表名。如果这个类名和数据库表名符合驼峰及下划线规则，可以省略这个注解。如FlowType类名对应表名flow_type。 @Id 指定这个字段为表的主键 @GeneratedValue(strategy=GenerationType.IDENTITY) 指定主键的生成方式，一般主键为自增的话，就采用GenerationType.IDENTITY的生成方式 @Column 注解针对一个字段，对应表中的一列。nullable = false表示数据库字段不能为空, unique = true表示数据库字段不能有重复值,length = 32表示数据库字段最大程度为32. @Data、@AllArgsConstructor、@NoArgsConstructor、@Builder都是插件lombok的注解，用来帮助我们生成set、get方法、构造函数等实体类的模板代码。

