创建一个可定时执行或周期执行任务的线程池，该方法可指定线程池的核心线程个数。 public void scheduledThreadPoolDemo(){ ScheduledExecutorService scheduledThreadPool = Executors.newScheduledThreadPool(3); //定时执行一次的任务，延迟1s后执行 scheduledThreadPool.schedule(new Runnable() { @Override public void run() { System.out.println(Thread.currentThread().getName()+", delay 1s"); } }, 1, TimeUnit.SECONDS); //周期性地执行任务，延迟2s后，每3s一次地周期性执行任务 scheduledThreadPool.scheduleAtFixedRate(new Runnable() { @Override public void run() { System.out.println(Thread.currentThread().getName()+", every 3s"); } }, 2, 3, TimeUnit.SECONDS);
} 运行结果： pool-1-thread-1, delay 1s
pool-1-thread-1, every 3s
pool-1-thread-2, every 3s
pool-1-thread-2, every 3s
... schedule(Runnable command, long delay, TimeUnit unit)，延迟一定时间后执行Runnable任务； schedule(Callable callable, long delay, TimeUnit unit)，延迟一定时间后执行Callable任务； scheduleAtFixedRate(Runnable command, long initialDelay, long period, TimeUnit unit)，延迟一定时间后，以间隔period时间的频率周期性地执行任务； scheduleWithFixedDelay(Runnable command, long initialDelay, long delay,TimeUnit unit)，与scheduleAtFixedRate()方法很类似，但是不同的是scheduleWithFixedDelay()方法的周期时间间隔是以上一个任务执行结束到下一个任务开始执行的间隔，而scheduleAtFixedRate()方法的周期时间间隔是以上一个任务开始执行到下一个任务开始执行的间隔，也就是这一些任务系列的触发时间都是可预知的。 ScheduledExecutorService功能强大，对于定时执行的任务，建议多采用该方法。
